$(document).ready(function() {


    if ($(window).scrollTop() > 120) {
        $('#nav_bar').addClass('navbar-fixed-top');
        $('.go-top').show();
    }
    if ($(window).scrollTop() < 121) {
        $('#nav_bar').removeClass('navbar-fixed-top');
        $('.go-top').hide();
    }


  $(window).scroll(function () {
    if ($(window).scrollTop() > 120) {
      $('#nav_bar').addClass('navbar-fixed-top');
      $('.go-top').show();
    }
    if ($(window).scrollTop() < 121) {
      $('#nav_bar').removeClass('navbar-fixed-top');
        $('.go-top').hide();
    }
  });
});

